import React from "react";
import "./Home.css";
import Cover from "../../img/bg-soap.png";
import Tap from "../../img/ic-tap.png";
import Logo from "../../img/bg-log.jpg";
import Settings from "../../img/setting.png";

const Home = () => {
  return (
    <div className="Home">
      <div className="back">
        <img src={Cover} alt="" />

        <div class="center-top-text">
          <div className="settings">
            <img src={Settings} alt="" />
          </div>
          <div className="logo">
            <img src={Logo} alt="" />
          </div>
          <div className="reduce-text">Let's Reduce and Reuse plastics</div>{" "}
          <div className="backs">
            <img src={Tap} alt="" />
          </div>
        </div>

        <div class="center-bottom-text">Touch to start your refill process</div>
      </div>
    </div>
  );
};

export default Home;
